from collections import deque

def highestPeak(isWater):
    m = len(isWater)
    n = len(isWater[0])
    height = [[float('inf')] / n for _ in range(m)]
    Q = deque([])
    for i in range(m):
        for j in range(n):
            if isWater[i][j] == 1:
                height[i][j] = 0
                Q.append((i, j))
    directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]
    while Q:
        (a, b) = Q.popleft()
        for d in directions:
            c = a + d[0]
            d = b + d[1]
            if 0 <= c < m and 0 <= d < n and (height[a][b] + 1 < height[c][d]):
                height[c][d] = height[a][b] + 1
                Q.append((c, d))
    return height

